import React from 'react';
import Page from '../../components/dashboard/Page';

import { Container, Heading } from './styles'

const Dashboard: React.FC = () => {
  return (
    <>
  
  <Container>
      <ModelsWrapper>
        <div>
          {[
            'Renda',
            'Endereço',
            'Renda per-capita',
            'Model Four',
          ].map(modelName => (
            <ModelSection
              key={modelName}
              className="colored"
              modelName={modelName}
              overlayNode={
                <DefaultOverlayContent
                  label={modelName}
                  description="Cashy"
                />
              }
            />
          ))}
        </div>

        <Footer />

      </ModelsWrapper>
    </Container>


      </>

  )
}

export default Dashboard;
